## Answer (0)

I have found the solution to my problem. The issue was that I was not using the correct method to create a guest user. I should have been using the `createUser` method with the `uid` parameter set to a unique value. Here is the correct code:

```
$email = 'guest@example.com';
$password = 'password123';
$displayName = 'Guest User';
$uid = uniqid();

$firebase = new Firebase([
    'apiKey' => 'my-api-key',
    'authDomain' => 'my-auth-domain',
    'databaseURL' => 'my-database-url',
    'storageBucket' => 'my-storage-bucket',
]);

$firebase->createUser([
    'uid' => $uid,
    'email' => $email,
    'password' => $password,
    'displayName' => $displayName,
]);
```

